var event;

/**
 * ...
 */
function keydown(event) {
  if (event.keyCode === 37) {
      this.position.x += (-0.1)
      this.rotation.z += 0.1
  }
  if (event.keyCode === 39) {
      this.position.x += 0.1
      this.rotation.z += (-0.1)
  }
  if (event.keyCode === 38) {
      this.position.z += (-0.1)
      this.rotation.x += (-0.1)
  }
  if (event.keyCode === 40) {
      this.position.z += 0.1
      this.rotation.x += 0.1
  }
}

